import React, {Component} from "react";

export default class Recherche extends Component{

    constructor(props) {
        super(props);
        this.state = {}
        /*this.state = {
            produit: undefined,
            description: undefined,
            prixMinMax: undefined,
            prixMinMin: undefined,
            dateDebutMax: undefined,
            dateDebutMin: undefined,
            durreeMin: undefined,
            durreMax: undefined,
            idCategorie: undefined,
        }*/

        this.handleInputChange = this.handleInputChange.bind(this);
    }

    componentDidMount() {

    }

    handleInputChange(event) {
        event.preventDefault();
        const target = event.target;
        this.setState({
            [target.name]: target.value,
        });

        console.log(this.state)
    }
    render() {

        return(
            <div className="mt-5">
                <div className="form-wrapper" >
                    <div className="form-title">
                        <h3>Recherche</h3>
                    </div>
                    <form className="w-100">
                        <div className="row">
                            <div className="col-12">
                                <div className="form-inner">
                                    <label>Produit</label>
                                    <input className="form-control" value={this.state.produit}
                                           onChange={this.handleInputChange} name="produit" type="text" placeholder="Entrer le nom du produit" />
                                </div>
                            </div>
                            <div className="col-6">
                                <div className="form-inner">
                                    <label>Prix Min</label>
                                    <input type="number" name="prixMin" id="password" placeholder="prix min" />
                                </div>
                            </div>
                            <div className="col-6">
                                <div className="form-inner">
                                    <label>Prix Max</label>
                                    <input type="number" name="prixMax" id="password" placeholder="prix max" />
                                </div>
                            </div>
                        </div>
                        <button className="btn-check">Log in</button>
                    </form>
                </div>
            </div>
        )
    }


}
